create table order_item (discount integer not null, customer_order_id bigint, food_id bigint unique, id bigint generated by default as identity, product_id bigint unique, primary key (id));
create table product (item_number integer, price integer, weight integer, id bigint generated by default as identity, color varchar(255), description varchar(255), status varchar(255) check (status in ('SOLD','NOT_SOLD')), type varchar(255) check (type in ('FURNITURE','TEXTILE')), primary key (id));
